import React from 'react';
import { Link } from 'react-router-dom';
import { StarIcon, ChatBubbleBottomCenterTextIcon } from '@heroicons/react/24/outline';
import { StarIcon as StarIconSolid } from '@heroicons/react/24/solid';

const Testimonials: React.FC = () => {
  const stats = [
    { number: "98%", label: "Client Satisfaction" },
    { number: "500+", label: "Valuations Completed" },
    { number: "15+", label: "Years Experience" }
  ];

  const testimonials = [
    {
      name: "Michael and Karen Mazzarella",
      location: "Sutherland",
      text: "The valuer was genuine, friendly and very professional. They arranged a valuation of our business quickly and was flexible to our time schedule. The final report is better than we expected.",
      image: "/images/129 Xclussive Business Sales Headshots Newcastle Feb 2022_ Noni Carroll Photography.jpg",
      rating: 5,
      business: "Retail Business Owner"
    },
    {
      name: "Chris Sarris",
      location: "Hunters Hill",
      text: "Thank you for the valuation of our business. My partner and I appreciate your prompt service and that you explained to us how you arrived at the valuation before the report.",
      image: "/images/152  Xclussive Headshots Newcastle Feb 2022_ Noni Carroll Photography.jpg",
      rating: 5,
      business: "Manufacturing Company"
    },
    {
      name: "Daniela De Vita",
      location: "Concord",
      text: "Engaging them to complete a comprehensive valuation of our business was an easy process from the beginning to end. Their knowledge around market trends really helped us to understand the final valuation.",
      image: "/images/57 Zoran Sarabaca-Xcllusive Headshots Mar 2021_Noni Carroll Photography.jpg",
      rating: 5,
      business: "Service Industry Professional"
    }
  ];

  const renderStars = (rating: number) => {
    return [...Array(5)].map((_, index) => (
      index < rating ? (
        <StarIconSolid key={index} className="w-5 h-5 text-yellow-400" />
      ) : (
        <StarIcon key={index} className="w-5 h-5 text-gray-300" />
      )
    ));
  };

  return (
    <div className="py-16 bg-gray-50">
      <div className="container">
        {/* Header Section */}
        <div className="text-center max-w-3xl mx-auto mb-16">
          <ChatBubbleBottomCenterTextIcon className="w-12 h-12 text-primary mx-auto mb-4" />
          <h1 className="text-4xl font-bold mb-6">What Our Clients Say</h1>
          <p className="text-xl text-gray-600 leading-relaxed">
            Don't just take our word for it. Here's what business owners across Australia 
            have to say about their experience with our valuation services.
          </p>
        </div>

        {/* Stats Section */}
        <div className="grid grid-cols-1 md:grid-cols-3 gap-8 mb-16">
          {stats.map((stat, index) => (
            <div key={index} className="bg-white rounded-lg p-6 text-center shadow-sm">
              <div className="text-4xl font-bold text-primary mb-2">{stat.number}</div>
              <div className="text-gray-600">{stat.label}</div>
            </div>
          ))}
        </div>

        {/* Testimonials Grid */}
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-8 mb-16">
          {testimonials.map((testimonial, index) => (
            <div 
              key={index} 
              className="bg-white rounded-lg shadow-sm hover:shadow-md transition-shadow duration-300"
            >
              <div className="p-8">
                <div className="flex items-center gap-4 mb-6">
                  <img 
                    src={testimonial.image} 
                    alt={testimonial.name}
                    className="w-16 h-16 rounded-full object-cover ring-2 ring-primary/10"
                  />
                  <div>
                    <h3 className="font-semibold text-lg">{testimonial.name}</h3>
                    <p className="text-gray-600 text-sm mb-1">{testimonial.business}</p>
                    <p className="text-primary text-sm">{testimonial.location}</p>
                  </div>
                </div>
                <div className="flex mb-4">
                  {renderStars(testimonial.rating)}
                </div>
                <blockquote className="text-gray-600 leading-relaxed">
                  "{testimonial.text}"
                </blockquote>
              </div>
            </div>
          ))}
        </div>

        {/* CTA Section */}
        <div className="bg-white rounded-lg shadow-sm p-12 text-center max-w-3xl mx-auto">
          <h2 className="text-2xl font-semibold mb-4">Ready to Get Your Business Valued?</h2>
          <p className="text-gray-600 mb-8 text-lg">
            Join hundreds of satisfied business owners who trust us for accurate, 
            reliable business valuations.
          </p>
          <Link 
            to="/contact" 
            className="btn btn-primary inline-block px-8 py-3 text-lg"
          >
            Request Your Valuation
          </Link>
        </div>
      </div>
    </div>
  );
};

export default Testimonials;
